import React, { useState } from 'react'; // Added useState for managing loading state
import { useNavigate } from 'react-router-dom';
import '../User/Usercss/User.css';
import { useForm } from 'react-hook-form';
import * as Yup from 'yup';
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import { yupResolver } from '@hookform/resolvers/yup';
import { userRegister } from '../services/index';

// Validation schema
const schema = Yup.object().shape({
  name: Yup.string().required('Name is required'),
  email: Yup.string().email('Invalid email').required('Email is required'),
  contact: Yup.string()
    .required('Mobile number is required')
    .matches(/^[0-9]+$/, 'Mobile number must be digits')
    .min(10, 'Mobile number must be at least 10 digits')
    .max(15, 'Mobile number must be at most 15 digits'),
  password: Yup.string().required('Password is required'),
});

export default function Register() {
  const navigate = useNavigate();
  const [loading, setLoading] = useState(false); 

  const {
    register,
    handleSubmit,
    formState: { errors },
  } = useForm({
    resolver: yupResolver(schema),
  });

  const userSubmit = async (data) => {
    setLoading(true); // Set loading to true
    try {
      const result = await userRegister(data);
      if (  result?.code === 201 || result?.code === 200) {
        toast.success(result.message);
        navigate('/user/product-list');
      } else {
        toast.error(result?.message || "Registration failed. Please try again.");
      }
    } catch (err) {
      console.error(err);
      toast.error("An error occurred. Please try again later.");
    } finally {
      setLoading(false); 
    }
  };

  return (
    <>
      <div className='container-fluid a'>
        <div className='row' style={{ background: "#e0f7fa", minHeight: '700px' }}>
          <div className='col-sm-2'></div>
          <div className='col-sm-4 py-5'>
            <h2><u style={{ color: '#00796b' }}>Sign</u> Up..??</h2>
            <form onSubmit={handleSubmit(userSubmit)}> {/* Corrected onSubmit handler */}
              <div className='mb-3'>
                <input
                  type="text"
                  className={`form-control w-100 ${errors.name ? 'is-invalid' : ''}`} 
                  placeholder='Enter Your Name'
                  {...register('name')}
                />
                {/* {errors.name && <div className='invalid-feedback'>{errors.name.message}</div>} */}
              </div>

              <div className='mb-3'>
                <input
                  type="email"
                  className={`form-control w-100 ${errors.email ? 'is-invalid' : ''}`} 
                  placeholder='Enter Your Email'
                  {...register('email')}
                />
                {/* {errors.email && <div className='invalid-feedback'>{errors.email.message}</div>} */}
              </div>

              <div className='mb-3'>
                <input
                  type="text" 
                  className={`form-control w-100 ${errors.contact ? 'is-invalid' : ''}`} 
                  placeholder='Enter Your Mobile'
                  {...register('contact')}
                />
                {/* {errors.contact && <div className='invalid-feedback'>{errors.contact.message}</div>} */}
              </div>

              <div className='mb-3'>
                <input
                  type="password"
                  className={`form-control w-100 ${errors.password ? 'is-invalid' : ''}`} 
                  placeholder='Enter Your Password'
                  {...register('password')}
                />
                {/* {errors.password && <div className='invalid-feedback'>{errors.password.message}</div>} */}
              </div>

              <div>
                <button type='submit' className='form-control w-100' style={{ background: '#00796b', color: 'white' }} disabled={loading}>
                  {loading ? 'Signing Up...' : 'Sign Up'} {/* Conditional button text */}
                </button>
              </div>
              <br />
              <h6 className='text-light'>
                <b style={{ color: '#00796b' }}>I have an already Account.?  </b>
                <a href='/user/login'>Login</a>
              </h6>
 
  

            </form>
          </div>
          
          <div className='col-sm-6'>
        <img   alt='no'
                src='data:image/png;base64,'
        //src="data:image/jpeg;base64,"
       style={{height:'400px'}}/>
        </div>
        </div>
      </div>
      <ToastContainer />
    </>
  );
}
